import React, { useState } from "react";
import { Line } from "react-chartjs-2";
import Calendar from 'react-calendar';

function ProgressPage() {
  const [progress, setProgress] = useState([
    { course: "React Basics", completion: 80, score: 85 },
    { course: "Advanced JavaScript", completion: 60, score: 78 },
    { course: "Data Science", completion: 40, score: 72 },
  ]);

  const [leaderboard] = useState([
    { name: "Alice", score: 95 },
    { name: "Bob", score: 88 },
    { name: "You", score: 85 },
    { name: "Charlie", score: 82 },
  ]);

  const [goals, setGoals] = useState([
    "Complete React Basics by next week üöÄ",
    "Score 90+ in JavaScript course üéØ",
    "Finish Data Science module by next month üìÖ",
  ]);

  const [reminders, setReminders] = useState([
    "Assignment on React due next Monday!",
    "Data Science exam in 2 weeks.",
  ]);

  const [quote, setQuote] = useState("Keep pushing forward! üí™");
  const [notes, setNotes] = useState([
    "Remember to review the React Lifecycle Methods.",
    "Data Science models can be tricky, focus on practice.",
  ]);

  const data = {
    labels: ['Week 1', 'Week 2', 'Week 3', 'Week 4'],
    datasets: [
      {
        label: 'Course Progress',
        data: [80, 85, 90, 95],
        borderColor: 'rgba(75,192,192,1)',
        fill: false,
      },
    ],
  };

  const [date, setDate] = useState(new Date());

  return (
    <div className="progress-container">
      <h1>üìà Progress Tracker</h1>
      <p>Track your course completion, scores, and achievements.</p>

      {/* Course Progress Section */}
      <div className="progress-section">
        {progress.map((item, index) => (
          <div key={index} className="course-card">
            <h3>{item.course}</h3>
            <p>Completion: {item.completion}%</p>
            <div className="progress-bar">
              <div
                className="progress-fill"
                style={{ width: `${item.completion}%` }}
              ></div>
            </div>
            <p>Score: {item.score}/100</p>
          </div>
        ))}
      </div>

      {/* Leaderboard */}
      <div className="leaderboard">
        <h2>üèÜ Leaderboard</h2>
        <ul>
          {leaderboard.map((user, index) => (
            <li key={index}>
              {index + 1}. {user.name} - {user.score} pts
            </li>
          ))}
        </ul>
      </div>

      {/* Goals */}
      <div className="goals">
        <h2>üéØ Your Goals</h2>
        <ul>
          {goals.map((goal, index) => (
            <li key={index}>{goal}</li>
          ))}
        </ul>
      </div>

      {/* Reminders */}
      <div className="reminders">
        <h2>üìÖ Reminders</h2>
        <ul>
          {reminders.map((reminder, index) => (
            <li key={index}>{reminder}</li>
          ))}
        </ul>
      </div>

      {/* Motivation */}
      <div className="motivational-quote">
        <h2>üåü Motivation of the Day</h2>
        <p>{quote}</p>
      </div>

      {/* Progress Graph */}
      <div className="progress-graph">
        <h2>üìä Progress Over Time</h2>
        <Line data={data} />
      </div>

      {/* Calendar */}
      <div className="calendar-section">
        <h2>üìÖ Upcoming Events</h2>
        <Calendar value={date} onChange={setDate} />
      </div>

      {/* Notes */}
      <div className="notes">
        <h2>üìù Course Notes</h2>
        <ul>
          {notes.map((note, index) => (
            <li key={index}>{note}</li>
          ))}
        </ul>
      </div>
    </div>
  );
}

export default ProgressPage;
